message:
Em Fortaleza , mesarios à serviço do PT compram votos na cara dura !!! 

Visitem nosso canal :
@cristaospelapatria

Segue uma pequena compilação de fatos e ações do nosso governo até junho de 2022.
Sugiro que seja enviado ao máximo de pessoas possível - principalmente a quem não entende o porquê do apoio de tantos milhões e do nosso empenho para a reeleição do presidente Bolsonaro. Estar informado e informando é essencial, a mídia mercenária não o fará.
Muitos, por estarem em uma bolha onde só são apresentadas as poucas más notícias do nosso governo e, a maior parte das vezes apresentadas de forma deturpada, eles não têm como ter uma mínima ideia da qualidade desse governo. E todas as conquistas, apesar da maior crise hídrica em 90 anos, da maior pandemia em 100 anos, guerra mais complexa desde a 2ª Guerra Mundial, inflação, maiores juros nos EUA e em diversos países em décadas, falência da Argentina vermelha, do sistema jogando pesado contra nosso governo, da mídia mercenária, do cenário adverso... Abaixo:



1. Segurança no Governo Bolsonaro:
Queda grande de roubo a banco;
Queda gigante no número de assassinatos – menor em décadas;
Apreensão recorde de drogas;
Queda gigante no número de invasões a propriedades e morte no campo;
Apoio moral e efetivo às forças de segurança;
Zero conversas cabulosas com traficantes;
2. Reformas a tanto desejadas no Governo Bolsonaro:
Digitalização de mais de 1000 Serviços (redução de burocracia e mais celeridade);
Bancarização recorde;
Informatização recorde;
Desestatização recorde;
Lei da Liberdade Econômica; 
Revolução positiva em termos de infraestrutura: pontes, asfalto por todo Brasil, água, cisternas, ferrovias, cabotagem... ; Conclusão de mais de 5 mil obras de infraestrutura; Mais de  mil obras para melhorar a infraestrutura turística do país; Rodovias: 196 obras entregas no total em todo o país;
Foco no setor de logística com “salto ferroviário”: Reabilitação do modal ferroviário com o Marco das Ferrovias e Programa Pró-Trilhos; 30 contratos para a construção de novas ferrovias (investimentos de 133 bilhões); 10 mil KM de malha ferroviária em construção; 11 mil KM de malha ferroviária em reabilitação;
Lei da cabotagem – Br do Mar; 
Lei do ambiente de negócios; 
Marco do Gás; 
Marco Cambial; 
Marco do Saneamento;
Acordo EU MercoSul;
Modernização da lei dos cartórios;
Digitalização dos cartórios;
Lei das Assinaturas Eletrônicas (reconhecimento de assinaturas eletrônicas em documentos, contratos...);
600 medidas para ajudar que as empresas não demitissem durante a pandemia;
Programa de transparência e fiscalização de estados e municípios;
Venda/Transferência de Veículos por meio Digital;
Autonomia do BC no Governo Bolsonaro;
Decreto de reforma das normas trabalhistas;
Saneamento e reformulação das empresas públicas ou de capital misto, levando todas de prejuízos históricos à lucros espetaculares: Caixa, BB, Correios, Porto de Santos, Ceagesp, BNDES... – empresas controladas pela união chegam a 188,7 bilhões de lucro em 2021;
Extinção de 27 mil cargos públicos;
Maior programa de privatização da história (402 bilhões em privatizações, concessões e desestatizações);
Revogação de 23 mil atos normativos (corte de burocracia e gastos);
Lei de Combate à fraude Previdenciária.
Sistema Balcão Único (abertura de empresas em poucas horas);
3. Apoio aos mais pobres no Governo Bolsonaro:
PEC que limita imposto de energia, combustível e telecomunicações;
Combate aos Lixões;
Mais de um milhão e duzentas mil casas populares entregues;
Mais títulos de terra que muitos dos últimos governos somados; +250 mil Títulos de propriedades rurais;
Reforma e ampliação de 2500 escolas no país;
Dois milhões de microcréditos oferecidos;
Programa Wi-Fi Brasil (15 mil pontos);
Transposição do Rio São Francisco, instalação de dessalinizadores, cisternas e poços artesianos…
Criação da Secretaria Nacional de Alfabetização e de programas de alfabetização baseado em evidências;
Aumento de 33,24% no salário dos professores da Educação Básica, o maior reajuste salarial para professores da história;
Criação de 130 Escolas Cívico-Militares;
Auxílio Brasil - maior programa de transferê

Auxílio Brasil - maior programa de transferência de renda da história do país. O novo benefício garante a subsistência de mais de 17 milhões de brasileiros durante o absurdo período do “fecha todo a economia vemos depois”;
3,5 milhões de famílias a mais no Auxílio Brasil que no bolsa família – e aumento no valor de 191 para 409 e agora para cerca de 600;
Auxílios:  emergencial, taxista, caminhoneiro, gás...;
Pix;
Renegociação e perdão de dívidas para os beneficiários do FIES;
Subsídio à gratuidade para idosos no transporte coletivo;
Repasse de R$ 500 bi para o programa Alimenta Brasil.
4. Política de impostos no Governo Bolsonaro:
Redução impostos de produtos desde 2019: remédios (contra o câncer, o HIV, a AIDS...), Jogos, absorventes, fraudas, itens de informática...;
Baixou ou reduziu Taxas de cerca de 800 itens de produção: máquinas, motores, ferramentas...;
Redução impostos diversos: folha de pagamento, energia elétrica, cilindros de oxigênio, energia solar, arroz, soja, milho e ainda diversos produtos insumo para medicamentos e eletro eletrônico;
5. Economia no Governo Bolsonaro:
Melhora na relação dívida/pib: 77%;
Brasil volta ao top 10 nas maiores economia, apesar da conjuntura mundial horrível;
Brasil figura entre os 10 maiores destino de investimento;
Brasil finalmente aceito na OCDE;
Bilhões economizados nos gastos do governo: Passagens, diárias, Licitação, contratações, publicidade, patrocínios... Mesmo com os investimentos gigantes com a covid, se o PCC não tivesse exportado o vírus chinês, a economia teria sido ainda maior;
Queda de desemprego, apesar do momento mais complicado do século, segue caindo: 9,4%, o menor nível desde 2015 - saldo de empregos com 4,7 milhões de novas vagas desde junho de 2020; Mais pessoas empregadas - maior primeiro trimestre desde 2015;
Dívida pública voltando ao nível pré crise; Ao fim da pior década da história da nossa economia, o Brasil estava demonstrando finalmente uma boa recuperação econômica com o saldo positivo de 640 mil empregos em 2019;
Um trilhão em investimentos estrangeiros já contratados;
PIB revisado para cima;
Inflação desacelerando;
Redução 25% IPI;
Redução do DPVAT;
Crescimento acumulado do pib durante a crise da covid - maior que o de quase todos os países mais ricos do mundo;
Programas e repasses ajudaram o Brasil a não parar durante o "fecha-tudo" promovido por governadores: bem preservou quase 10 milhões de empregos; pronampe garantiu crédito para cerca de 700 mil pequenas empresas; pec maquininhas garantiu créditos para mais de 100 mil pequenos negócios; repasses para estados e municípios chegou a r$375 bilhões; foram r$ 60 bilhões em suspensão de dívidas dos estados e municípios;
Quase 300 acordos internacionais assinados desde 2019 - importantes cooperações com Japão, emirados árabes e estados unidos;
Abertos mais de 200 mercados para produtos agropecuários brasileiros em 51 países desde 2019;
 O Brasil teve a melhor recuperação econômica pós-Covid entre os países do G7, tornando-se destaque mundial;
Auxílio a estados para a manutenção da competitividade do etanol sobre a gasolina;
Fim gradual IOF câmbio;
FIM do imposto federal do gás liquefeito de petróleo (GLP);
Redução 20% Tarifa Externa Comum (TEC MERCOSUL), redução 20% do regime tarifário de Bens de Capital e Bens de Informática e Telecomunicações (BIT BK);
Redução ICMS combustivel e energia para 17%.
Manutenção do endividamento público no patamar pré-pandemia;
Conclusão das negociações dos acordos comerciais com a União Européia e com o EFTA;
Maior fluxo de comércio da história;
Maior superavit comercial da história;
Adesão do Brasil ao Acordo de Contratações Governamentais (GPA), que permitirá a participação de empresas estrangeiras em licitações no Brasil e de empresas brasileiras em licitações no exterior;
Abertura do 1º Escritório Regional da Organização Mundial do Turismo nas Américas;
Criação do Prosul;
Melhora de 124ª para 65ª no Ranking Doing Business do Banco Mundial;
Venda de Imóveis da União (arrecadação de mais de 100 bilhões);
...

6. E mais (no Governo Bolsonaro):
Maior parte dos ministros técnicos fim da indicação política para cargos técnicos;
Fim da corrupção institucionalizada;
Moralização da Lei Ruanet;
Combate à pauta lacradora;
Diminuição de veiculação de propaganda para obter simpatia de emissoras;
Diminuição patrocínios milionários a eventos e times;
Defesa pela vida;
Defesa da pátria;
Defesa dos cristãos;
Defesa da família;
Defesa da Amazônia e da soberania brasileira;
Enfrentamento diário ao sistema podre: mídia mercenária, esquerda corrupta, stf...
Programa adote um parque;
Lei do Superendividamento (recuperação de indivíduos com endividamento excessivo);
Lei do Cadastro positivo;
Lei das Reguladoras; 
Revisão da Cessão onerosa; 
Lei das telecomunicações; 
Lei de crédito agrícola; 
Lei de divisão da dívida tributária; 
Lei da informática; 
Lei da falência; 
Lei da internet das coisas; 
Lei das Startaps; 
Nova Lei de Licitações; 
Reforma da Previdência;
Regime de Partilha;
Novo FGTS;
Desindexação dos salários públicos;
Propriedade industrial;
Marco legal das garantias;
Nova política de Mineração;
Estudos e realizações de privatizações;
Redução das taxas CVM;
Redução do Adicional ao Frete para Renovação da Marinha Mercante (AFRMM);
Brasil como um dos 5 principais destinos de investimentos externos (2019-2021);
Acordo de Salvaguardas Tecnológicas que irá fazer de Alcântara um dos centros da indústria aero-espacial;
O mundo inteiro foi surpreendido pela crise do vírus chinês, mas a reação do Brasil foi rápida e prudente, buscando salvar a vida e a dignidade dos brasileiros.
Estamos minimizando problemas históricos do País, como a alta carga tributária, o inchaço da máquina burocrática e o excessivo controle econômico. Com mais liberdade, é mais fácil superar a crise global;
Apesar de toda incerteza, as vendas do varejo aumentaram;
